import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "./Dashboard.css";

const EmployeeDashboard = () => {
  const [employee, setEmployee] = useState(null);
  const [wasteDeliveries, setWasteDeliveries] = useState([]);
  const [processingUpdates, setProcessingUpdates] = useState([]);
  const [productListings, setProductListings] = useState([]);
  const [reports, setReports] = useState([]);

  useEffect(() => {
    const employeeId = localStorage.getItem("userId");

    if (employeeId) {
      // Fetch employee details
      fetch(`http://localhost:8085/api/employees/get/${employeeId}`)
        .then((response) => response.json())
        .then((data) => setEmployee(data))
        .catch((error) => console.error("Error fetching employee data:", error));

      // Fetch waste intake data
      fetch("http://localhost:8085/api/waste-intake")
        .then((response) => response.json())
        .then((data) => setWasteDeliveries(data))
        .catch((error) => console.error("Error fetching waste deliveries:", error));

      // Fetch processing status updates
      fetch("http://localhost:8085/api/processing-status")
        .then((response) => response.json())
        .then((data) => setProcessingUpdates(data))
        .catch((error) => console.error("Error fetching processing updates:", error));

      // Fetch product listings
      fetch("http://localhost:8085/api/products")
        .then((response) => response.json())
        .then((data) => setProductListings(data))
        .catch((error) => console.error("Error fetching product listings:", error));

      // Fetch reports and certifications
      fetch("http://localhost:8085/api/reports")
        .then((response) => response.json())
        .then((data) => setReports(data))
        .catch((error) => console.error("Error fetching reports:", error));
    } else {
      console.error("No employee ID found in localStorage");
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("userId");
    alert("Logged out successfully!");
    window.location.href = "/";
  };

  return (
    <div className="employee-dashboard">
      <header className="dashboard-header">
        <div className="logo">Waste Processing Unit Dashboard</div>
        <div className="profile">
          <span>{employee?.name || "Employee Name"}</span>
          <button className="logout-button" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </header>

      <section className="main-dashboard">
        <h2>Welcome, {employee?.name || "Employee"}!</h2>
        <p><strong>Department:</strong> {employee?.department || "Waste Management"}</p>
      </section>

      {/* Waste Intake Management Section */}
      <section className="waste-intake-section">
        <h3>Waste Intake Management</h3>
        <div className="card-container">
          {wasteDeliveries.length > 0 ? (
            wasteDeliveries.map((delivery) => (
              <div key={delivery.id} className="card">
                <h4>Delivery ID: {delivery.id}</h4>
                <p>Type: {delivery.type}</p>
                <p>Volume: {delivery.volume} kg</p>
                <p>Source: {delivery.source}</p>
              </div>
            ))
          ) : (
            <p>No waste deliveries available.</p>
          )}
        </div>
      </section>

      {/* Processing Status Updates Section */}
      <section className="processing-status-section">
        <h3>Processing Status Updates</h3>
        <div className="card-container">
          {processingUpdates.length > 0 ? (
            processingUpdates.map((update) => (
              <div key={update.id} className="card">
                <h4>Process ID: {update.id}</h4>
                <p>Status: {update.status}</p>
                <p>Stage: {update.stage}</p>
                <p>Completion Time: {update.completionTime}</p>
              </div>
            ))
          ) : (
            <p>No processing updates available.</p>
          )}
        </div>
      </section>

      {/* Product Listings Section */}
      <section className="product-listings-section">
        <h3>Product Listings</h3>
        <div className="card-container">
          {productListings.length > 0 ? (
            productListings.map((product) => (
              <div key={product.id} className="card">
                <h4>Product: {product.name}</h4>
                <p>Type: {product.type}</p>
                <p>Price: {product.price} per unit</p>
                <p>Availability: {product.availability ? "Available" : "Out of Stock"}</p>
              </div>
            ))
          ) : (
            <p>No products available.</p>
          )}
        </div>
      </section>

      {/* Reports and Certifications Section */}
      <section className="reports-section">
        <h3>Reports & Certifications</h3>
        <div className="card-container">
          {reports.length > 0 ? (
            reports.map((report) => (
              <div key={report.id} className="card">
                <h4>Report ID: {report.id}</h4>
                <p>Processed Waste: {report.processedVolume} kg</p>
                <p>Output Products: {report.productOutput}</p>
                <p>Certification: {report.certification || "Not Certified"}</p>
              </div>
            ))
          ) : (
            <p>No reports available.</p>
          )}
        </div>
      </section>

      {/* Action Buttons Section */}
      <section className="action-buttons">
        <Link to="/processing-unit/manage-intake">
          <button className="action-button">Manage Waste Intake</button>
        </Link>
        <Link to="/processing-unit/manage-products">
          <button className="action-button">Manage Products</button>
        </Link>
        <Link to="/processing-unit/generate-reports">
          <button className="action-button">Generate Reports</button>
        </Link>
      </section>
    </div>
  );
};

export default EmployeeDashboard;
